import React from "react";
import { Container } from "reactstrap";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Provider } from "react-redux";
//COMPONENTS

import NavBarComp from "./components/NavBarComp";
import Stadiums from "./components/Stadiums";
import Login from "./components/Login";
import Register from "./components/Register";
import Stadium from "./components/Stadium";
import Booking from "./components/Booking";
import StadiumAddForm from "./components/StadiumAddForm";
import MyStadiums from "./components/MyStadiums";
import myStore from './redux/store'

//////////////////////////////////////////////////

const App = () => {
  return (
    <Provider store={myStore}>
      <Router>
        <NavBarComp />
        <AlertComp/>
        <Container>
          <Switch>
            <Route exact path="/" component={Stadiums} />
            <Route exact path="/register" component={Register} />
            <Route exact path="/login" component={Login} />
            <Route exact path="/stadium" component={Stadium} />
            <Route exact path="/book" component={Booking} />
            <Route exact path="/mystadiums" component={MyStadiums} />
            <Route exact path="/stadiumform" component={StadiumAddForm} />
          </Switch>
        </Container>
      </Router>
    </Provider>
  );
};

export default App;
